// src/App.jsx
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/pages/Home';
import Vol_Data from './components/pages/volunteer/Vol_Data';
import Events_2023_24 from './components/pages/events/Events_2023_24';
import Team_2023_24 from './components/pages/team/Team_2023_24';


function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" exact component={Home} />
          <Route path="/Vol_Data" component={Vol_Data} />
          <Route path="/Events_2023_24" component={Events_2023_24} />
          <Route path="/Team_2023_24" component={Team_2023_24} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
